The \color{blue!20} is the color for the line that says "First document. This is a simple example, with no extra parameters or packages included." The line with the text "First document" is the line that should be colored blue, while the line with the text "This is a simple example, with no extra parameters or packages included" is the line that should be colored red.
The \begin{equation*} is the equation in the middle of the first line. The line with the text "f" and "g" is the line that should be colored blue.

